import React from "react";
import { useState, useEffect } from "react";
import { Card } from "../../UI/Card.styled";
import { ImageCard } from "../../UI/ImageCard.styled";
import { CardSpan } from "../../UI/CardSpan.styled";
import { Button } from "../../UI/Button.styled";
import Experiences from "./List";
import Education from "./Education";
import List from "./List";
const SectionThree = ({ fontSizes, UI, colors }) => {
  const rendered = [
    {
      Header: "Experiences",
      lists: [
        {
          Year: 2019,
          name: "Dental App",
        },
        {
          Year: 2019,
          name: "NFT App",
        },
      ],
    },
    {
      Header: "Education",
      lists: [
        {
          Year: 2021,
          name: "Udemy course",
        },
        {
          Year: 2019,
          name: "Pirple",
        },
      ],
    },
  ];
  return (
    <>
      <Card
        mg={"0rem 3rem"}
        dp={"grid"}
        gridC={"50% 50%"}
        height={"20rem"}
        bd={"1px solid red"}
      >
        <Experiences fontSizes={fontSizes} UI={UI} colors={colors} />
        <Education fontSizes={fontSizes} UI={UI} colors={colors} />
      </Card>
    </>
  );
};

export default SectionThree;
